echo "Adding curl and jq"
apk --no-cache add curl jq

echo "STRAPI USER SETUP"

# TODO: handle the case were the admin user is already registered

# Create admin user
n=0
until [ $n -ge 10 ]
do
   token=$(curl --header "Content-Type: application/json" \
   --request POST \
   --data '{"username":"strapiUser","email":"user@strapiUser.io","password":"strapiUser"}' \
   http://strapi/auth/local/register | jq -r '.jwt')
   echo "token: $token"
   if [ -n "$token" ] || [ "$token" = "null" ]
   then
     break
   fi
   n=$((n+1))
   sleep 5
done

if [ -z "$token" ] || [ "$token" = "null" ]
then
     echo "strapi token is empty"
     exit 0
fi

# Add user data
result=$(curl --header "Content-Type: application/json" --header "Authorization: Bearer $token" \
   --request POST \
   --data '{"userid":"100","name":"John Smith","email":"john.smith@example.com","type":"user"}' \
   http://strapi/users | jq  -r ".error")
# check for error
if [ "$result" != "null" ]
   then
        echo "error insert user data in strapi: $result"
fi

